import React, {Component} from 'react';
import Axios from 'axios';
import {Link} from "react-router-dom";

import "./NavBar.css";

class NavBar extends Component {
    render(){     
        const logout = () => {
            Axios.post("http://localhost:3001/logout", {
            })
        }

        return ( 
            <div>
                <nav className="navBar">
                    
                    <li>
                        <a className="options"><Link to="/"><img src={"./images/logo.png"}/>Home</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/draft">Confession Draft</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/signup">Sign Up</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/login">Login</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/makeconfession">Make Confession</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/" onClick={logout}>Logout</Link></a>
                    </li>
                </nav>
            </div>
        )
    }
}

export default NavBar;
